import logo from './kebabLogoNoBg.png'
import Navbar from './components/navbar'
import Login from './components/login'
import React, { Component } from 'react';

class App extends Component {
  render(){
    return (
      <>
      <Navbar
      logo={logo}/>

      <div className="container">
        <Login/>
      </div>
      </>
    );
  }
}

export default App;
